import React from 'react'
import AppListItem from './app-list-item'

const AppList = ({prop}) => {

  const elems = prop.map((item) => {

    const {id, ...itemProps} = item;

    return (
      <li key={id}><AppListItem  {...itemProps}/></li>
    );
  });
  
  return (
      <ul className='app-list'>
        {elems}
      </ul>
    );
  };

  export default  AppList;
